import styled from 'styled-components'

export const Body = styled.body`
  background: #f2f2f2;
`

export const Input = styled.input`
  margin: 0 10px; 
  border: 1px solid #555;
  border-radius: 0%;
  color: #fff;
  width: 80px;
  height: 30px;
  background: #555555;
`

export const Corpo = styled.body`
  width: 1000px;
  margin: 100px auto;
  background: #f2f2f2;
`

export const Form = styled.form`
  width: 1000px;
  display: flex;
  margin: 80px auto;
  flex-wrap: wrap;
`

export const Title = styled.section`
  width: 600px;
  margin: 0 auto;
  display: flex;
`

export const H1 = styled.h1 `
  font-family: Sans-serif;
  margin: 0 auto;
`

export const Img = styled.section`
  width: 230px;
  display: flex;
  margin: 0 auto;
  padding: 0 10px;
`

export const Textarea = styled.textarea`
  width: 610px;
  height: 210px;
`

export const Container = styled.body`
  width: 430px;
`

export const Input2 = styled.input`
  width: 430px;
  height: 28px;
`

export const Section = styled.body`
  width: 610px;
`
